        rLocalLHS(9,6)+=ScaleFactor*(LMMasterNormal[0]*DeltaMOperator[2](1,0) + LMMasterNormal[1]*DeltaMOperator[2](1,1) - LMSlaveNormal[0]*DeltaDOperator[2](1,0) - LMSlaveNormal[1]*DeltaDOperator[2](1,1));
        rLocalLHS(9,7)+=ScaleFactor*(LMMasterNormal[0]*DeltaMOperator[3](1,0) + LMMasterNormal[1]*DeltaMOperator[3](1,1) - LMSlaveNormal[0]*DeltaDOperator[3](1,0) - LMSlaveNormal[1]*DeltaDOperator[3](1,1));
